export default class Default extends Component {
    render() {
        
        return (
            <div className="container">
                <div className="row">
                    <div className="col-10 mx-auto text-center text-title text-uppercase pt-5">
                        
                    </div>
                </div>
                
            </div>
        )
    }
}
